import { Routes, Route, Link } from "react-router-dom";
import {Home} from "./pages/Home";
import {Category}  from "./pages/Category";


function App() {
    // return <Home /> ;
    return (
      <Routes>
        <Route path="/" element={<Home />}></Route>
        <Route path="/category" element={<Category />}></Route>
      </Routes>
    )
}

export default App;
